 Voltage : 12 VDC<br>Pump Rated Current : 0.21 A<br>Pump Power Consumption : 2.52 W<br>Fan Dimensions : 120×120×25 mm<br>Fan Speed : 500~1800 RPM±10%<br>Fan Airflow : 69.34 CFM<br>Fan Air Pressure : 2.42 mmAq<br>Fan Noise : ≤30 dB(A)<br>Fan Connector : 4-pin PWM<br>Bearing Type : Hydro Bearing<br>Fan Rated Voltage : 12 VDC<br>Fan Power Consumption : 2.04 W<br>LED Type : Addressable RGB LED<br>LED Connector : 3-pin(+5V-D-G)<br>LED Rated Voltage : 5 VDC<br>LED Power Consumption : 2.25 W（PUMP）/ 4.8 W（FAN×2）<br>EAN : 6933412726609<br>P/N : DP-GS-H12AR-CSL240V2</p>',2500,5,1579000,10),(183,19,'Logitech G413 Carbon Mechanical Gaming Keyboard','<p>Windows\" 10, Windows 8.1, Windows 8, Windows 7<br>Port USB (untuk keyboard)<br>Port USB kedua (untuk port USB passthrough)<br>Akses internet untuk Logitech Gaming Software<br><br>KONTEN KEMASAN<br>Gaming keyboard<br>Gaming keycap<br>Keycap puller<br>Dokumentasi pengguna<br><br>SPESIFIKASI FISIK<br>Tinggi: 132 mm<br>Lebar: 445 mm<br>Tebal: 34 mm<br>Berat (tanpa kabel): 1.105 g<br>Kabel: 1,8 m<br><br>KENOP MEKANIK ROMER-G:<br>Daya tahan: 70 juta penekanan tombol<br>Jarak aktuasi: 1,5 mm<br>Kekuatan aktuasi: 45 g<br>Total jarak yang dilalui: 3,0 mm<br><br>SPESIFIKASI KEYBOARD:<br>Jenis Koneksi: USB Type A (berkabel)<br>Protokol USB: USB 2.0<br>Kecepatan USB: Full Speed<br>Lampu Indikator (LED): 2<br>Port USB (Internal): 1, USB 2.0<br><br>Cahaya Latar: Ya<br>Satu warna (5 tingkat kecerahan tetap)<br>G413 Silver: Putih<br>G413 Carbon: Merah<br><br>Tombol Khusus<br>Toggle Cahaya Latar: FN + F7<br>Mode Game: FN + F8<br>Kontrol Media: FN + F9/F10/F11/F12<br><br><br>PURE. POWER. PLAY.<br>Keseimbangan Sempurna Antara Kesederhanaan dan Kapabilitas<br>G413 memiliki konsep, rancangan, dan modifikasi untuk menghadirkan kinerja tingkat lanjut hanya dengan serangkaian fitur yang tepat. Case terbaik yang ringan, berbahan paduan aluminium 5052 yang kuat menyediakan kerangka yang ramping berbentuk belati. Di bagian bawahnya terdapat manajemen kabel untuk mouse dan headset, serta dilengkapi penyangga dengan stabilizer karet agar bermain game lebih nyaman walaupun sedang berada di gameplay berintensitas tinggi.<br><br>MEKANIKAL TERDEPAN<br>Dirancang untuk Menjadi Unggul<br>Switch mekanikal Romer-G\' dikembangkan dengan tujuan untuk menghasilkan kinerja, ketanggapan, dan daya tahan kelas pro. Aktuasi singkat 1,5mm lebih cepat 25% dibandingkan switch mekanikal standar lainnya. Perpaduan kecepatan, presisi, dan kinerja hening menjadikan Romer-G sebagai switch mekanikal keyboard gaming yang paling ideal.</p><p><br>&nbsp;</p>',1500,1,1025000,5),(184,19,'Logitech G502 HERO High Performance Gaming Mouse','<p>Spesifikasi Teknis<br>Penelusuran<br>-Sensor: HERO\'<br>-Resolusi: 100 \'\'\" 16.000 dpi<br>-Zero smoothing/akselerasi/filtering<br>-Maks. akselerasi: &gt; 40 G2<br>-Maks. kecepatan: &gt; 400 IPS2<br><br>Ketanggapan<br>-Format data USB: 16 bit/axis<br>-Report rate USB: 1.000 Hz (1 md)<br>-Mikroprosesor: 32-bit ARM<br><br>Daya Tahan<br>-Tombol utama: 50 juta klik<br>-Alas PTFE: 250 kilometer2<br><br>Fitur lain<br>-Onboard memory: 5 profil<br>-LIGHTSYNC RGB: 1 zona<br>-Braided cable<br><br>Spesifikasi fisik<br>-Tinggi: 132 mm<br>-Lebar: 75 mm<br>-Tebal: 40 mm<br>-Berat: 121 g, mouse saja<br>-Pemberat tambahan opsional: hingga 18 g (5x3,6 g)<br>-Panjang kabel: 2,10 m<br><br>Persyaratan Sistem<br>-Windows\" 7 atau versi terbaru<br>-macOS 10.11 atau versi terbaru<br>-Chrome OS\'<br>-Port USB<br><br>Konten Kemasan<br>-G502 HERO Gaming Mouse<br>-Pemberat 5x 3,6 g opsional<br>-Dokumentasi pengguna<br><br>&nbsp;</p>',1000,1,799000,9),(185,7,'test','<p>test</p>',2000,0,232323,10);
